import React, { ReactElement } from 'react'
import Link from 'next/link'

export default function Index(): ReactElement {
  return (
    <div>
      <Link href="/about">
        <a>About Page</a>
      </Link>
      <p>Hello Next.js</p>
    </div>
  )
}
